import React, { Component } from "react";
import Movie from "./movie";
import { getMovies } from "../services/fakeMovieService";

class Movies extends Component {
  state = {
    movies: getMovies()
  };

  handleDelete = movie => {};

  render() {
    return (
      <main className="container">
        <table>
          <tbody>"movies"</tbody>
        </table>
      </main>
    );
  }
}

export default Movies;
